public class AlipayConfiguration { @Bean public AlipayConfig alipayConfig(AliProperties aliProperties) { AlipayConfig config = new AlipayConfig(); //支付宝测试环境服务器 config.setServerUrl(aliProperties.getServerUrl()); //支付宝应用id，在沙箱环境内获取 config.setAppId(aliProperties.getAppId()); //引用私钥，建议使用《支付宝开放平台开发助手》生成，RSA2 config.setPrivateKey(aliProperties.getPrivateKey()); //json config.setFormat(aliProperties.getFormat()); //支付宝的公钥，不是咱自己的。沙箱应用处获取 config.setAlipayPublicKey(aliProperties.getPublicKey()); //UTF-8 config.setCharset(aliProperties.getCharrset()); //RSA2 config.setSignType(aliProperties.getSignType()); System.out.println(aliProperties.toString()); return config; } @Bean public AlipayClient alipayClient(AlipayConfig config) { try { return new DefaultAlipayClient(config); } catch (AlipayApiException e) { throw new RuntimeException(e); } }
} 支付： public AlipayTradePagePayResponse pay(PaymentRequest request) throws AlipayApiException { AlipayTradePagePayRequest aliReq = new AlipayTradePagePayRequest(); AlipayTradePagePayModel model = new AlipayTradePagePayModel(); model.setOutTradeNo(""+request.getOutTradeNo()); model.setSubject(request.getSubject()); model.setTotalAmount(request.getTotalAmout()); model.setProductCode(request.getProductCode()); aliReq.setBizModel(model); aliReq.setReturnUrl("http://localhost:8081/order"); aliReq.setNotifyUrl("https://6217to9865.goho.co/pay/pay/ali_callback"); AlipayTradePagePayResponse response = alipayClient.pageExecute(aliReq); return response; } 支付回调： @RequestMapping("/ali_callback")
public Object aliCallback(HttpServletRequest request) { Map<String,String> params = combineRequestParams(request); try { boolean verified = AlipaySignature.rsaCheckV2(params, aliProperties.getPublicKey(), "utf-8", aliProperties.getSignType()); if(!verified) { return ServerResponse.badRequest().body("非法请求，验证不通过"); } String status = params.get("trade_status"); if("TRADE_SUCCESS".equals(status)) { String out_trade_no = params.get("out_trade_no"); Pay pay = payService.getByUUID(out_trade_no); pay.setPayDate(new Date()); pay.setStatus(PayStatus.PAID.name()); payService.saveOrUpdate(pay); return "success"; } //确认支付状态是支付成功 //确认价格一致 //需要添加更新订单处理。 return "fail"; } catch (AlipayApiException e) { log.info("支付宝回调异常", e); return "fail"; }
} private static Map<String, String> combineRequestParams(HttpServletRequest request) { Map<String,String> params = new HashMap<>(); Map requestParams = request.getParameterMap(); for(Iterator it = requestParams.keySet().iterator(); it.hasNext();) { String name = (String) it.next(); String[] values = (String[]) requestParams.get(name); String valueStr = ""; for(int i=0; i<values.length; i++) { valueStr = i==(values.length-1) ? valueStr+values[i] : valueStr+values[i]+","; } params.put(name, valueStr); } params.remove("sign_type"); return params;
}

